import React from 'react';
import AdaugaPacient from './AdaugaPacient';

const DoctorDashboard = () => {
  // Ia datele din localStorage (sau din context, dacă folosești context)
  const userType = localStorage.getItem('userType');
  const doctorEmail = localStorage.getItem('email');

  return (
    <div className="doctor-dashboard">
      <h1>Doctor Dashboard</h1>
      {/* Afișează formularul doar dacă utilizatorul este doctor */}
      {userType === 'doctor' && <AdaugaPacient doctorEmail={doctorEmail} />}
    </div>
  );
};

export default DoctorDashboard;
